import React, { useState } from 'react';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';
import '../styles/HomePage.css';

const HomePage = () => {
  const [notes, setNotes] = useState([]);
  const [newNote, setNewNote] = useState({ text: '', topic: '', tag: '' });
  const [showPopup, setShowPopup] = useState(false);
  const [showCalendarPopup, setShowCalendarPopup] = useState(false); // Состояние для календаря в попапе

  const handleAddNote = () => {
    setNotes([...notes, newNote]);
    setNewNote({ text: '', topic: '', tag: '' });
  };

  const handleDeleteNote = (index) => {
    setNotes(notes.filter((_, i) => i !== index));
  };

  return (
    <div className="home-page">
      {notes.length === 0 && (
        <div className="centered-text">Жду ваши заметки!</div>
      )}

      <div className="note-form">
        <input
          type="text"
          value={newNote.topic}
          onChange={(e) => setNewNote({ ...newNote, topic: e.target.value })}
          placeholder="Тема заметки"
          className="note-input"
        />
        <input
          type="text"
          value={newNote.tag}
          onChange={(e) => setNewNote({ ...newNote, tag: e.target.value })}
          placeholder="Тег"
          className="note-input"
        />
        <textarea
          value={newNote.text}
          onChange={(e) => setNewNote({ ...newNote, text: e.target.value })}
          placeholder="Текст заметки"
          className="note-input"
        />
        <button onClick={handleAddNote} className="note-button">Записать</button>
      </div>

      {showPopup && (
        <div className="popup">
          <div className="popup-content">
            <p>{newNote.text}</p>
            <button onClick={() => setShowPopup(false)} className="popup-close">Закрыть</button>
          </div>
        </div>
      )}

      <div className="notes-container">
        {notes.map((note, index) => (
          <div className="note" key={index}>
            <div className="note-header">
              <span>{note.topic} - {note.tag}</span>
              <button
                onClick={() => handleDeleteNote(index)}
                className="delete-note"
              >
                Удалить
              </button>
            </div>
            <p>{note.text}</p>
            <button
              onClick={() => setShowPopup(true)}
              className="view-note"
            >
              Смотреть
            </button>
          </div>
        ))}
      </div>

      {/* Календарь для больших экранов */}
      <div className="calendar-container">
        <Calendar />
      </div>

      {/* Кнопка для календаря на маленьких экранах */}
      <button
        className="calendar-button"
        onClick={() => setShowCalendarPopup(true)}
      >
        Открыть календарь
      </button>

      {/* Попап с календарем */}
      {showCalendarPopup && (
        <div className="popup">
          <div className="popup-content">
            <Calendar />
            <button
              onClick={() => setShowCalendarPopup(false)}
              className="popup-close"
            >
              Закрыть
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default HomePage;
